import React from 'react';
import { Link } from 'react-router-dom';
import './TabNav.css';

const TabNav = ({ activeTab, category, manufacturer, series, model, categoryName, manufacturerName, seriesName, modelName, setActiveTab }) => {
  return (
    <div className="tab-nav">
      <div className={`tab-item ${activeTab === 'category' ? 'active' : ''}`} onClick={() => setActiveTab('category')}>
        <Link to="/">Category</Link>
        {categoryName && <div className="subtitle">{categoryName}</div>}
      </div>
      <div className={`tab-item ${activeTab === 'manufacturer' ? 'active' : ''} ${!category ? 'disabled' : ''}`} onClick={() => category && setActiveTab('manufacturer')}>
        <Link to={`/${category}`}>Manufacturer</Link>
        {manufacturerName && <div className="subtitle">{manufacturerName}</div>}
      </div>
      <div className={`tab-item ${activeTab === 'series' ? 'active' : ''} ${!manufacturer ? 'disabled' : ''}`} onClick={() => manufacturer && setActiveTab('series')}>
        <Link to={`/${category}/${manufacturer}`}>Series</Link>
        {seriesName && <div className="subtitle">{seriesName}</div>}
      </div>
      <div className={`tab-item ${activeTab === 'model' ? 'active' : ''} ${!series ? 'disabled' : ''}`} onClick={() => series && setActiveTab('model')}>
        <Link to={`/${category}/${manufacturer}/${series}`}>Model</Link>
        {modelName && <div className="subtitle">{modelName}</div>}
      </div>
      <div className={`tab-item ${activeTab === 'alternative' ? 'active' : ''} ${!model ? 'disabled' : ''}`} onClick={() => model && setActiveTab('alternative')}>
        <Link to={`/${category}/${manufacturer}/${series}/${model}/alternatives`}>Alternative</Link>
      </div>
    </div>
  );
};

export default TabNav;
